import styled from "styled-components";

export const StyledRenopwacja = styled.section`
width: 90%;
margin-left: 5%;
margin-top: 30px;
display: flex;
flex-direction: column;
align-items: center;
justify-content: center;
`;


export const BIO = styled.div`
width: 100%;
font-size: 1.2em;
`;

export const List = styled.div`
margin: 0;
margin-top: 50px;
padding: 0;
width: 100%;
font-size: 1.2em;
`;
